import React, { useState } from 'react';

function LoginForm() {
  const [token, setToken] = useState('');

  function handleSubmit(event) {
    event.preventDefault();
    // Send the token to a server or do something else with it here
  }

  return (
    <form  onSubmit={handleSubmit}>
      <label>
        Token
      </label>
	  <input className='form-group' type="text" value={token} onChange={event => setToken(event.target.value)} />
      <button type="submit">Submit</button>
    </form>
  );
}

export default LoginForm;
